INSERT INTO `trends` (`id`, `judul`, `img`, `year`, `konten`, `slug`, `created_at`, `updated_at`) VALUES
(1, 'Tren warna nusantara 2018', 'img/trend/16057718112018.jpg', '2018', '<div class=\"\">\n	<div class=\"color-2018\">\n		<div class=\"container\">\n			<section>\n				<div class=\"space-m d-flex align-items-center text-white\">\n					<div class=\"container\">\n						<div class=\"row\">\n							<div class=\"col-md-6 align-self-center center-mobile\">\n								<p class=\"sp-2 small text-uppercase mb-0\">Tren warna nusantara 2018</p>\n								<h2 class=\"text-capitalize title-2 display-5 ts-small\">Tarian Nusantara</h2>\n								<p class=\"lead\">Tren warna dengan nuansa ungu yang tegas bertemakan Tarian nusantara untuk rumah Anda.</p>\n								<div class=\"d-none d-sm-block hero\"> <a href=\"javascript:void(0)\" class=\"btn btn-primary  \">Eksplor tren warna</a>\n								</div>\n							</div>\n							<div class=\"col-md-6\">\n								<div class=\"center-mobile\">\n									<img src=\"http://warna.sci-paint.com/img/years/18-11.png\" alt=\"\" width=\"100%\" class=\"w-80-mobile\">\n								</div>\n								<div class=\"d-sm-none d-block text-center mt-3 mt-sm-0 hero\"> <a href=\"javascript:void(0)\" class=\"btn btn-primary\">Eksplor tren warna</a>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</section>\n		</div>\n	</div>\n	<section class=\"space-m bg-white\" id=\"hero\">\n		<div class=\"container\">\n		<p class=\"sp-2 small text-uppercase mb-0 text-center\">Royal Rajah</p>\n		<p class=\"sp-2 title-2 text-uppercase mb-0 text-center\">Color of the years</p>\n		<img src=\"http://warna.sci-paint.com/img/years/18-12.jpg\" alt=\"\" width=\"100%\">\n			<div class=\"my-5 col-md-10 offset-md-1\">\n				<div class=\"testimonial-group\">\n					<div class=\"row text-white\">\n						<div class=\"col-4\">\n							<div class=\"card rounded h-100 color-2018\">\n								<div class=\"p-5\">\n									<div class=\"position-absolute \" style=\"top:-53px;left:-51px\">\n										<img src=\"http://warna.sci-paint.com/img/years/tr2.png\" alt=\"\" width=\"50%\" class=\"mb-4 d-sm-block d-none\">\n									</div>\n									<div class=\"z-in-1 position-relative\">\n										<h5 class=\"text-capitalize title-2\">Tarian Dari <br> Pulau Bali</h5>\n										<p>Implementasi warna untuk rumah yang pekat dengan budaya dari pulau dewata bali.</p>\n									</div>\n								</div>\n							</div>\n						</div>\n						<div class=\"col-4\">\n							<div class=\"card rounded h-100\" style=\"background:#8C75A2\">\n								<div class=\"p-5\">\n									<div class=\"position-absolute text-right \" style=\"bottom:-73px;right:8px;\">\n										<img src=\"http://warna.sci-paint.com/img/years/tr3.png\" alt=\"\" width=\"60%\" class=\"mb-4 d-sm-block d-none\">\n									</div>\n									<div class=\"z-in-1 position-relative\">\n										<h5 class=\"text-capitalize title-2\">Tarian Dari <br> Jawa Barat</h5>\n										<p>Implementasi warna untuk rumah yang pekat dengan budaya dari pulau jawa barat.</p>\n									</div>\n								</div>\n							</div>\n						</div>\n						<div class=\"col-4\">\n							<div class=\"card rounded h-100\" style=\"background:#A693BC\">\n								<div class=\"p-5\">\n									<div class=\"position-absolute text-right \" style=\"top:-53px;right:-51px\">\n										<img src=\"http://warna.sci-paint.com/img/years/tr4.png\" alt=\"\" width=\"50%\" class=\"mb-4 d-sm-block d-none\">\n									</div>\n									<div class=\"z-in-1 position-relative\">\n										<h5 class=\"text-capitalize title-2\">Tarian Dari <br> Jakarta</h5>\n										<p>Implementasi warna untuk rumah yang pekat dengan budaya dari jakarta.</p>\n									</div>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n			<br>\n			<div class=\"text-center\">\n				<p class=\"lead text-normali\">Kami mengimprovisasikan kekayaan budaya indonesia untuk dijadikan sebagai panduan dalam memilih tren warna di tahun 2018, dengan tema Tarian Nusantara. Warna dengan konsep ungu merupakan tren warna tahun ini.</p>\n			</div>\n		</div>\n	</section>\n</div>\n<section class=\"space-m color-2018-light\">\n	<div class=\"container\">\n		<div class=\"text-center\">\n			<p class=\"sp-2 small text-uppercase mb-0\">Color Of The years 2018</p>\n			<h2 class=\"text-capitalize title-2 ts-small display-5\">Royal Rajah</h2>\n			<div class=\"mt-4\">\n				<div class=\"row pt-mobile\">\n					<div class=\"col-8\">\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/18-5.jpg\" data-caption=\"Royal Rajah - 7142\">\n							<div class=\"h-100\" style=\"background:url(\'http://warna.sci-paint.com/img/years/18-5.jpg\');background-size:cover;background-position:center\"></div>\n						</a>\n					</div>\n					<div class=\"col-4\">\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/18-8.jpg\" data-caption=\"Royal Rajah - 7142\">\n							<img src=\"http://warna.sci-paint.com/img/years/18-8.jpg\" alt=\"\" width=\"100%\">\n						</a>\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/18-9.jpg\" data-caption=\"Royal Rajah - 7142\">\n							<img src=\"http://warna.sci-paint.com/img/years/18-9.jpg\" alt=\"\" width=\"100%\" class=\"mt-4\">\n						</a>\n					</div>\n				</div>\n			</div>\n			<p class=\"lead mt-4 text-normali\">Kami menobatkan warna spectrum royal rajah 7149 sebagai tren warna 2018 karena memiliki ketegasan ungu yang sangat kuat dan modern sangat cocok untuk di implementasikan pada rumah maupun proyek anda.</p>\n		</div>\n	</div>\n</section>\n<section class=\"space-m bg-white\">\n	<div class=\"container\">\n		<div class=\"row flex-column-reverse flex-lg-row mt-4\">\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#583F64\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Royal Rajah</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Royal Rajah</p>\n							<p class=\"mb-0\">7142</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Tari Bali tidak selalu bergantung pada alur cerita. Tujuan utama penari Bali adalah untuk menarikan tiap tahap gerakan dan rangkaian dengan ekspresi penuh. Kecantikan tari Bali tampak pada gerakan-gerakan yang abstrak dan indah. Tari-tari Bali yang paling dikenal antara lain pendet, gambuh, baris, sanghyang dan legong.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Royal-Rajah\" class=\"btn btn-primary\" target=\"_blank\">Dapatkan warna</a>\n			</div>\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/18-3.jpg\" data-caption=\"Royal Rajah - 7142\">\n					<img src=\"http://warna.sci-paint.com/img/years/18-3.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n		</div>\n		<div class=\"row mt-4\">\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/18-1.jpg\" data-caption=\"Cha Cha - AC 103*#\">\n					<img src=\"http://warna.sci-paint.com/img/years/18-1.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#EEC400\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Cha Cha</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Cha Cha</p>\n							<p class=\"mb-0\">AC 103*#</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Tari Jawa Barat Jaipongan mempunyai ciri khas gaya kaleran, yakni keceriaan, erotis, humoris, semangat, spontanitas, dan kesederhanaan (alami, apa adanya). Hal itu tercermin dalam pola penyajian tari pada pertunjukannya, ada yang diberi pola (Ibing Pola) seperti pada seni Jaipongan yang ada di Bandung, juga ada pula tarian yang tidak dipola (Ibing Saka), misalnya pada seni Jaipongan Subang dan Karawang.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Cha-Cha\" class=\"btn btn-primary\" target=\"_blank\">Dapatkan warna</a>\n			</div>\n		</div>\n		<div class=\"row flex-column-reverse flex-lg-row mt-4\">\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#174E46\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Country Meadow</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Country Meadow</p>\n							<p class=\"mb-0\">7541</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Tari Jakarta Seni tari tradisional Betawi sangat erat dengan alunan irama musik tradisional. Tarian Betawi juga mempunyai ciri khas tersendiri, yaitu penggunaan suara musik pengiring yang riang serta gerakan-gerakan tari yang dinamis.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Country-Meadow\" class=\"btn btn-primary\" target=\"_blank\">Dapatkan warna</a>\n			</div>\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/18-2.jpg\" data-caption=\"Country Meadow - 7541\">\n					<img src=\"http://warna.sci-paint.com/img/years/18-2.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n		</div>\n	</div>\n</section>\n<section class=\"color-2018-light pt-5\">\n	<div class=\"container\">\n		<div class=\"text-center\">\n			<p class=\"sp-2 small text-uppercase mb-0\">Royal Rajah - 7142</p>\n			<h2 class=\"text-capitalize title-2 mb-0 ts-small display-5\">Detail warna</h2>\n			<p class=\"lead text-normali\">Arti warna ungu melambangkan pengharapan besar, aura spiritual, misterius menarik perhatian, bermartabat, independen, sensivitas, kekuatan, imajinasi, obsesif, ambisius. Warna ungu ini unik, jarang ditemui di alam.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Royal-Rajah\" target=\"_blank\" class=\"btn btn-primary mb-3 mb-sm-0\">Dapatkan Warna</a>\n		</div>\n		<div class=\"images\">\n			<img src=\"http://warna.sci-paint.com/img/years/18-13.png\" alt=\"\" width=\"100%\">\n			<div class=\"bottom-center\"></div>\n		</div>\n	</div>\n</section>\n<section class=\"space-m bg-white\">\n	<div class=\"container\">\n		<div class=\"d-flex justify-content-between flex-column flex-lg-row\">\n			<div class=\"center-mobile\">\n				<p class=\"lead mb-0 text-normali\">Bagikan inpirasi tren warna melalui\n					<br>social media.</p>\n			</div>\n			<div class=\"align-self-center\">\n				<div class=\"mt-3 mt-sm-0\">\n					<div class=\"a2a_kit text-center d-flex align-items-center justify-content-center justify-content-sm-start\">\n							<a class=\"btn-primary btn-icon-2 a2a_button_whatsapp\" style=\"padding-top:10px\"> <i class=\"bi bi-whatsapp\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_facebook\" style=\"padding-top:10px\"> <i class=\"lab la-facebook-f\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_twitter\" style=\"padding-top:10px\"> <i class=\"bi bi-twitter\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_copy_link\" style=\"padding-top:10px\"> <i class=\"bi bi-share-fill\"></i> \n							</a>\n						</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n        \n        \n        \n        ', 'tren-warna-nusantara-2018', '2020-11-19 00:43:31', '2021-02-24 18:33:06'),
