le\">\n					<div class=\"col-8\">\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/19-3.jpg\" data-caption=\"Golden Mist - 8517\">\n							<div class=\"h-100\" style=\"background:url(\'http://warna.sci-paint.com/img/years/19-3.jpg\');background-size:cover;background-position:center\"></div>\n						</a>\n					</div>\n					<div class=\"col-4\">\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/19-5.jpg\" data-caption=\"Golden Mist - 8517\">\n							<img src=\"http://warna.sci-paint.com/img/years/19-5.jpg\" alt=\"\" width=\"100%\">\n						</a>\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/19-4.jpg\" data-caption=\"Golden Mist - 8517\">\n							<img src=\"http://warna.sci-paint.com/img/years/19-4.jpg\" alt=\"\" width=\"100%\" class=\"mt-4\">\n						</a>\n					</div>\n				</div>\n			</div>\n			<p class=\"lead mt-4 text-normali\">Kami menobatkan warna spectrum golden mist 8517 sebagai tren warna 2019 karena memiliki ketegasan coklat yang sangat kuat dan modern sangat cocok untuk di implementasikan pada rumah maupun proyek anda.</p>\n		</div>\n	</div>\n</section>\n<section class=\"space-m bg-white\">\n	<div class=\"container\">\n		<div class=\"row flex-column-reverse flex-lg-row\">\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#9B733C\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Golden Mist</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Golden Mist</p>\n							<p class=\"mb-0\">8517</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Tren warna di tahun 2019 dengan tema Fauna Nusantara. Warna dengan konsep coklat merupakan tren warna tahun ini. Kami menjadikan harimau sebagai media utama dalam memilih konsep karena melambangkan ketegasan dan keberanian yang sangat kuat.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Golden-Mist\" class=\"btn btn-primary \" target=\"_blank\">Dapatkan warna</a>\n			</div>\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/18-14.jpg\" data-caption=\"Golden Mist - 8517\">\n					<img src=\"http://warna.sci-paint.com/img/years/18-14.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n		</div>\n		<div class=\"row mt-4\">\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/19-6.jpg\" data-caption=\"Gray whale cove - 8247\">\n					<img src=\"http://warna.sci-paint.com/img/years/19-6.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#6D7079\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Gray whale cove</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Gray whale cove</p>\n							<p class=\"mb-0\">8247</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Warna pada ‘Badak Jawa’ yang memiliki skema warna abu-abu. Abu-abu menandakan sesuatu yang tenang dan menyejukkan. Warna ini sangat sempurna untuk segala jenis gaya arsitektural mulai dari klasik, modern, hingga kontemporer.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Gray-Whale-Cove\" class=\"btn btn-primary \" target=\"_blank\">Dapatkan warna</a>\n			</div>\n		</div>\n		<div class=\"row mt-4\">\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#F86F29\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Light my fire</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Light my fire</p>\n							<p class=\"mb-0\">AC 114*</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Warna kuning pada \'Burung Cenderawasih’. Kuning merupakan warna yang cerah, hangat dan bercahaya. Kuning menambahkan optimisme ke rumah Anda, mendorong perasaan bahagia pada semua orang yang masuk.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Light-my-fire\" class=\"btn btn-primary mb-3 mb-sm-0\" target=\"_blank\">Dapatkan warna</a>\n			</div>\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/19-7.jpg\" data-caption=\"Light my fire - AC 114*\">\n					<img src=\"http://warna.sci-paint.com/img/years/19-7.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n		</div>\n	</div>\n</section>\n<section class=\"color-2019-light pt-5\">\n	<div class=\"container\">\n		<div class=\"text-center\">\n			<p class=\"sp-2 small text-uppercase mb-0\">Golden Mist - 8517</p>\n			<h2 class=\"text-capitalize title-2 mb-0 ts-small display-5\">Detail warna</h2>\n			<p class=\"lead text-normali\">Warna coklat memberi pengaruh pada pikiran dan tubuh dengan menciptakan perasaan kebajikan, stabilitas, dan kedamaian. Coklat memberikan perasaan terorganisir, historik, dan koneksi, serta perasaan santai dan hangat yang nyaman. Warna ini diyakini membantu menciptakan perasaan sehat, koneksi dengan bumi, dan rasa ketertiban dan konvensi.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Golden-Mist\" target=\"_blank\" class=\"btn btn-primary \">Dapatkan Warna</a>\n		</div>\n		<div class=\"images\">\n			<img src=\"http://warna.sci-paint.com/img/bg-kaleng.png\" alt=\"\" width=\"100%\">\n			<div class=\"bottom-center\"></div>\n		</div>\n	</div>\n</section>\n<section class=\"space-m bg-white\">\n	<div class=\"container\">\n		<div class=\"d-flex justify-content-between flex-column flex-lg-row\">\n			<div class=\"center-mobile\">\n				<p class=\"lead mb-0 text-normali\">Bagikan inpirasi tren warna melalui\n					<br>social media.</p>\n			</div>\n			<div class=\"align-self-center\">\n				<div class=\"mt-3 mt-sm-0\">\n					<div class=\"a2a_kit text-center d-flex align-items-center justify-content-center justify-content-sm-start\">\n							<a class=\"btn-primary btn-icon-2 a2a_button_whatsapp\" style=\"padding-top:10px\"> <i class=\"bi bi-whatsapp\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_facebook\" style=\"padding-top:10px\"> <i class=\"lab la-facebook-f\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_twitter\" style=\"padding-top:10px\"> <i class=\"bi bi-twitter\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_copy_link\" style=\"padding-top:10px\"> <i class=\"bi bi-share-fill\"></i> \n							</a>\n						</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>\n        ', 'tren-warna-nusantara-2019', '2020-11-19 01:05:51', '2021-02-24 18:40:55'),
(3, 'Tren warna nusantara 2020', 'img/trend/16057735712020.jpg', '2020', '<div class=\"\">\n	<div class=\"color-2020\">\n		<div class=\"container\">\n			<section>\n				<div class=\"space-m d-flex align-items-center text-white\">\n					<div class=\"container\">\n						<div class=\"row\">\n							<div class=\"col-md-6 align-self-center center-mobile\">\n								<p class=\"sp-2 small text-uppercase mb-0\">Tren warna nusantara 2020</p>\n								<h2 class=\"text-capitalize title-2 display-5 ts-small\">Bahari Nusantara</h2>\n								<p class=\"lead\">Tren warna dengan nuansa biru yang tegas bertemakan Bahari nusantara untuk rumah Anda.</p>\n								<div class=\"d-none d-sm-block hero\"> <a href=\"javascript:void(0)\" class=\"btn btn-primary \">Eksplor tren warna</a>\n								</div>\n							</div>\n							<div class=\"col-md-6\">\n								<div class=\"center-mobile\">\n									<img src=\"http://warna.sci-paint.com/img/years/20-1.png\" alt=\"\" width=\"100%\" class=\"w-80-mobile\">\n								</div>\n								<div class=\"d-sm-none d-block text-center mt-3 mt-sm-0 hero\"> <a href=\"javascript:void(0)\" class=\"btn btn-primary \">Eksplor tren warna</a>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</section>\n		</div>\n	</div>\n	<section class=\"space-m bg-white\" id=\"hero\">\n		<div class=\"container\">\n			<p class=\"sp-2 small text-uppercase mb-0 text-center\">Wavy Navy</p>\n			<p class=\"sp-2 title-2 text-uppercase mb-0 text-center\">Color of the years</p>\n			<img src=\"http://warna.sci-paint.com/img/years/20-2.jpg\" alt=\"\" width=\"100%\">\n			<div class=\"col-md-8 offset-md-2 over-19\">\n				<div class=\"row mt-4\">\n					<a href=\"/palet-warna/spectrum-interior-exterior-paint/Wavy-Navy\" class=\"text-dark col-4\" target=\"_blank\">\n						<div class=\"media text-left d-flex justify-content-center\">\n							<div class=\"round-icon bg-primary p-small me-2\">\n								<div class=\"round-icon\" style=\"height:100px;width:100px;background-colo