class=\"mt-4\">\n				<div class=\"row pt-mobile\">\n					<div class=\"col-8\">\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/20-4.jpg\" data-caption=\"Wavy Navy - AC 146\">\n							<div class=\"h-100\" style=\"background:url(\'http://warna.sci-paint.com/img/years/20-4.jpg\');background-size:cover;background-position:center\"></div>\n						</a>\n					</div>\n					<div class=\"col-4\">\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/20-5.jpg\" data-caption=\"Luxury Color Texture\">\n							<img src=\"http://warna.sci-paint.com/img/years/20-5.jpg\" alt=\"\" width=\"100%\">\n						</a>\n						<a data-fancybox=\"19-1\" href=\"http://warna.sci-paint.com/img/years/20-6.jpg\" data-caption=\"Wavy Navy - AC 146\">\n							<img src=\"http://warna.sci-paint.com/img/years/20-6.jpg\" alt=\"\" width=\"100%\" class=\"mt-4\">\n						</a>\n					</div>\n				</div>\n			</div>\n			<p class=\"lead mt-4 text-normali\">Kami menobatkan warna spectrum Wavy Navy 7149 sebagai tren warna 2020 karena memiliki ketegasan biru yang sangat kuat dan modern sangat cocok untuk di implementasikan pada rumah maupun proyek anda.</p>\n		</div>\n	</div>\n</section>\n<section class=\"space-m bg-white\">\n	<div class=\"container\">\n		<div class=\"row flex-column-reverse flex-lg-row mt-4\">\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#005488\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Wavy Navy</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Wavy Navy</p>\n							<p class=\"mb-0\">AC 146</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Tren warna di tahun 2020 dengan tema Bahari Nusantara. Warna dengan konsep biru merupakan tren warna tahun ini. Kami menjadikan Bahari nusantara sebagai media utama dalam memilih konsep karena mempunyai kekayaan alam yang tak terbatas.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Wavy-Navy\" class=\"btn btn-primary \" target=\"_blank\">Dapatkan warna</a>\n			</div>\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/20-7.jpg\" data-caption=\"Wavy Navy - AC 146\">\n					<img src=\"http://warna.sci-paint.com/img/years/20-7.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n		</div>\n		<div class=\"row mt-4\">\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/20-8.jpg\" data-caption=\"Baby Sprout - AC 160\">\n					<img src=\"http://warna.sci-paint.com/img/years/20-8.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#6C8B44\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Baby Sprout</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Baby Sprout</p>\n							<p class=\"mb-0\">AC 160</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Hijau adalah warna yang sangat membumi. Hal itu bisa mewakili awal dan pertumbuhan baru. Bisa juga menandakan pembaruan dan kelimpahan. Warna ini punya banyak atribut menenangkan yang sama dengan warna biru.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Baby-Sprout\" class=\"btn btn-primary \" target=\"_blank\">Dapatkan warna</a>\n			</div>\n		</div>\n		<div class=\"row flex-column-reverse flex-lg-row mt-4\">\n			<div class=\"col-md-6 align-self-center\">\n				<div class=\"mb-4 mt-3 mt-sm-0\">\n					<div class=\"media text-left d-flex justify-content-center\">\n						<div class=\"round-icon bg-primary p-small me-2\">\n							<div class=\"round-icon\" style=\"height:100px;width:100px;background-color:#9CD9D0\"></div>\n						</div>\n						<div class=\"media-body align-self-center mt-3 mt-sm-0\">\n							<h1 class=\"mb-0 title-2 d-none d-sm-block\">Kylemore</h1>\n							<p class=\"mb-0 title-2 d-sm-none d-block\">Kylemore</p>\n							<p class=\"mb-0\">7529</p>\n						</div>\n					</div>\n				</div>\n				<p class=\"lead text-normali\">Warna hijau pastel merupakan warna yang mempunyai karakter natural dan menenangkan. Karena merupakan warna alam, yaitu warna hijau. Mengadaptasi dari warna dedaunan yang menyegarkan.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Kylemore\" class=\"btn btn-primary \" target=\"_blank\">Dapatkan warna</a>\n			</div>\n			<div class=\"col-md-6\">\n				<a data-fancybox=\"19-2\" href=\"http://warna.sci-paint.com/img/years/20-9.jpg\" data-caption=\"Kylemore - 7529\">\n					<img src=\"http://warna.sci-paint.com/img/years/20-9.jpg\" alt=\"\" width=\"100%\">\n				</a>\n			</div>\n		</div>\n	</div>\n</section>\n<section class=\"color-2020-light pt-5\">\n	<div class=\"container\">\n		<div class=\"text-center\">\n			<p class=\"sp-2 small text-uppercase mb-0\">Wavy Navy - AC 146</p>\n			<h2 class=\"text-capitalize title-2 mb-0 ts-small display-5\">Detail warna</h2>\n			<p class=\"lead text-normali\">Arti biru sangat dipengaruhi tergantung pada bayangan dan corak yang tepat. Warna biru muda seringkali digambarkan rileks dan menenangkan. Warna biru cerah bisa memberi energi dan menyegarkan.</p> <a href=\"/palet-warna/spectrum-interior-exterior-paint/Wavy-Navy\" target=\"_blank\" class=\"btn btn-primary mb-3 mb-sm-0\">Dapatkan Warna</a>\n		</div>\n		<div class=\"images\">\n			<img src=\"http://warna.sci-paint.com/img/years/20-3.png\" alt=\"\" width=\"100%\">\n			<div class=\"bottom-center\"></div>\n		</div>\n	</div>\n</section>\n<section class=\"space-m bg-white\">\n	<div class=\"container\">\n		<div class=\"d-flex justify-content-between flex-column flex-lg-row\">\n			<div class=\"center-mobile\">\n				<p class=\"lead mb-0 text-normali\">Bagikan inpirasi tren warna melalui\n					<br>social media.</p>\n			</div>\n			<div class=\"align-self-center\">\n				<div class=\"mt-3 mt-sm-0\">\n					<div class=\"a2a_kit text-center d-flex align-items-center justify-content-center justify-content-sm-start\">\n							<a class=\"btn-primary btn-icon-2 a2a_button_whatsapp\" style=\"padding-top:10px\"> <i class=\"bi bi-whatsapp\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_facebook\" style=\"padding-top:10px\"> <i class=\"lab la-facebook-f\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_twitter\" style=\"padding-top:10px\"> <i class=\"bi bi-twitter\"></i> \n							</a>\n							<a class=\"btn-primary btn-icon-2 ms-2 a2a_button_copy_link\" style=\"padding-top:10px\"> <i class=\"bi bi-share-fill\"></i> \n							</a>\n						</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</section>', 'tren-warna-nusantara-2020', '2020-11-19 01:12:51', '2020-11-19 01:12:51');
